  02> WILSON, Sharyn Ailsa
  b 13.07.1975
  04> KEMP, Dennis Bruce
  b 12.08.1959
  Dennis b. at Napier. Address: Cambridge.
  01> KEMP, Bruce Francis m on ** ** **** to (2)RENNER, Beatrice Mary
  b 20.04.1924
  b 31.01.1926
  Beatrice, d/o Edward Henry Renner and May Violet Hawkings, b. at Auckland. Address: 11 Waiora Road,
  Stanmore Bay, Whangaparaoa.
  Bruce is a retired insurance executive. He has been an active member of the RSA since 1948 and is a
  life member of the Whakatane branch and recipient of an NZRSA Merit Award. He is also a Justice of the
  Peace.
  |
  02> KEMP, Colin William m on 08.01.1949 to GUNSON, Muriel Beryl
  b 23.11.1926 d 20.02.1995
  b 15.09.1930
  Colin b. at Gisborne, m. at Warkworth, d, at McLeod Bay and bd. at sea. Muriel, d/o Charles Leonard
  Gunson and Jane Edith Gant, b. at Whangarei. Address: 2/2 Mair Street, Whangarei.
  Colin attended primary school in Gisborne whilst boarding with his grandmother then went to Feilding
  Agricultural High School from 1939 to 1942. He worked with his parents on the family farm until it was
  sold in the 1940's. They purchased another property in Warkworth, but returned to Gisborne when Colin's
  father's health failed, Colin worked at Rodney Dairy Factory advancing to first assistant, then bought
  a 30 acre farmlet and also worked for Keith Hay at Warkworth. He shifted to Whangarei in 1958
  sharemilking a large herd until health problems forced him to give it up. He was involved in wool
  buying until he retired in 1987.
  01> KEMP, Christine Rose m on 02.03.1968 to CLAPHAM, Peter Stanley
  b 31.12.1949
  b 10.11.1946
  Christine b. at Warkworth and m, at Kamo, Peter, s/o Charlton Frederick Clapham and Evelyn Winifred
  Wilson, b. at Whangarei. (Peter's grandfather, Archibald Clapham, donated his clock collection to
  the City of Whangarei to form the Clapham Clocks Museum.) Address: Clapham Road, Whareora (PO Box
  135), Whangarei.
  Christine moved to Whangarei in 1958. She has worked in garden centres and has owned West End
  Flowers, Her interests include gardening and beach camping.
  Peter is a carpenter.
  01> CLAPHAM, Marie Louise
  b 10.09.1968
  Marie b, at Whangarei. Address: 2/98 May Road, Mount Roskill, Auckland.
  Marie attended school in Whangarei and moved to Auckland in 1984. She is an administrator in
  the dental industry. Between 1992 and 1995 she travelled in Africa, Europe and Egypt and
  worked as a nanny in England.
  02> CLAPHAM, Deborah Jane m on 21.03.1992 to MYOCEVICH, Shane John
  (Debbie)
  b 24.06.1970
  b 17.07.1965
  Deborah b. at Whangarei and m, at Kamo, Shane, s/o Mervyn Clarence Myocevich and Freda Shirley
  Field, Address: 18 Tait Street, Kamo, Whangarei.
  Debbie was a laboratory technician in the dairy industry and is now selling real estate. Her
  interests are horseriding, aerobics and tennis.
  (cont...).
